import React from "react";
import { Route, Routes } from "react-router-dom";
import User from "./User";
import { Search } from "./search";



const App = () => {
  return (
   
      <div>
        <h1>qqqqqqqqqqqqqqqqq</h1>
        <Routes>
          <Route path="/:fname" element={<User/>}/>
          <Route path="/search" element={<Search/>}/>     
        </Routes>
      </div>
    
  );
};

export default App;
